import http from "../http-common";
import authHeader from './authJwt/auth-header';

const API_URL = 'http://localhost:8080/api/v1/';

class NoteDataService {
    getAll(params) {
        return ax.get(`/v1/notes/pageData`,{params},{ headers: authHeader() });
    }

    get(id) {
        return http.get(`/v1/note/${id}`);
      }

    create(data){
        return http.post(API_URL + `note`, data, { headers: authHeader() });
    }

    update(id, data) {
        return http.put(`/v1/notes/${id}`, data);
      }


    delete(id) {
        return http.delete(`/v1/${id}`)
    }


    deleteAll() {
        return http.delete(`/notes`);
      }

    findByTitle(title) {
    return http.get(`/v1/notes?searchTitle=${title}`);
    }
}
